import React, { Component } from "react";

export default class extends Component {
  render() {
    return (
      <div>
        <h1 className="title-container__title">Weather Finder</h1>
        <h3 className="title-container__subtitle">
          Find out temperature, conditions & more....
        </h3>
      </div>
    );
  }
}
